import "./style/skills.css"
import SkillItems from "./SkillItems";
import SkillCard from "./SkillCard";
function Skills() {
    return(
        <div>
            <div className="grid">
            {SkillItems.map((Item) => <SkillCard Item={Skill}/>)}
            </div>
        </div>
    )
}

export default Skills;
